import React,{useState} from 'react'
import './App.css'

export function App() {
    let[counter,updateCounter] = useState(0);
    return (
        <div>
            <h1 className='name'>Hello, Mansoor</h1>
            <h2>Counter: {counter}</h2>
            <button onClick={ () => {
                    updateCounter(++counter)
            }} >Click to update count</button>
        </div>
    )
}
